import { v4 as uuid } from "uuid"
const today = new Date()
export const addTweet = ({
    id = uuid(),
    username = "",
    tweetBody = "",
    tweeted_date = today.toDateString(),
    comments = 0,
    retweets = 0,
    likes = 0,
} = {}) => ({
    type: "ADD_TWEET",
    tweet_payload: {
        id,
        username,
        tweeted_date,
        comments,
        retweets,
        likes,
    },
})
